Using the TVs internal measurements, buy an aquarium and any additional components necessary including a filter, air pump, overhead light, and tubing. Make sure the tank that is wider and slightly taller than the screen. Be especially careful to leave room between the top of the aquarium and the lid of the console for an overhead light, which your fish and plants will need if they’re going to be enclosed in a dark box. Place the air pump inside the cabinet  to suppress the noise. However, it can be mounted outside if there is not enough room. {"smallUrl":"https://www.wikihow.com/images/thumb/d/dc/Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet1.jpg/v4-459px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet1.jpg","bigUrl":"https://www.wikihow.com/images/thumb/d/dc/Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet1.jpg/v4-759px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet1.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

If you don’t have space to fit an overhead light inside the console, consider getting a remote ballast light instead. {"smallUrl":"https://www.wikihow.com/images/thumb/9/9d/Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet2.jpg/v4-459px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet2.jpg","bigUrl":"https://www.wikihow.com/images/thumb/9/9d/Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet2.jpg/v4-759px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet2.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
</p><p><br />
</p></div>"}

If your TV console won't fit a standard tank size, you can have one custom-built to fit. {"smallUrl":"https://www.wikihow.com/images/thumb/7/72/Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet3.jpg/v4-459px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet3.jpg","bigUrl":"https://www.wikihow.com/images/thumb/7/72/Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet3.jpg/v4-759px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-7Bullet3.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
