</p></div>"}

The most elegant way of approaching this is to cut the entire existing lid off at the seams. Attach hinges and turn it into a flip lid. Alternatively, you can remove the existing top and replace it with a flip lid made from a new piece of wood stained to match the old paneling. {"smallUrl":"https://www.wikihow.com/images/thumb/f/f6/Convert-an-Old-TV-Into-a-Fish-Tank-Step-10Bullet1.jpg/v4-459px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-10Bullet1.jpg","bigUrl":"https://www.wikihow.com/images/thumb/f/f6/Convert-an-Old-TV-Into-a-Fish-Tank-Step-10Bullet1.jpg/v4-759px-Convert-an-Old-TV-Into-a-Fish-Tank-Step-10Bullet1.jpg","smallWidth":460,"smallHeight":306,"bigWidth":760,"bigHeight":506.31868131868134,"licensing":"<div class="mw-parser-output"><p>License: <a rel="nofollow" class="external text" href="https://creativecommons.org/licenses/by-nc-sa/3.0/">Creative Commons</a><br>
